import React from "react";
import { Menu } from 'semantic-ui-react'

const NavBar = props => {
  return (
    <Menu inverted>
        <Menu.Item
          name='Super Duper Fun Time Trivia App 2000'/>
        <Menu.Item
          onClick={(e) => console.log(e)} name="Login"/>

    </Menu>

  )
}

export default NavBar;
